import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          hey, i'm amelia kaufman.
        </p>
        <p> i am a software engineering manager for my day job. <br></br>
          at night, i am currently a masters candidate in computer science at georgia tech with a specialiation in ml/ai. <br></br>
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
